      padding: 0,
      color: '#0eff00',
      '&$checked': {
        transform: 'translateX(39px)',
        color: '#488214',
        '& + $track': {
          opacity: 1,
          backgroundColor: '#0eff00',
          borderColor: '#5c5c5c',
        },
      },
    },
    thumb: {
      width: 20,
      height: 20,
      boxShadow: 'none',
    },
    track: {
      border: `1px solid ${'5c5c5c'}`,
      borderRadius: 16 / 2,
      opacity: 1,
      backgroundColor: '#5c5c5c',
